import React from "react";
import "./Chart.css";
import ChartBar from "./ChartBar";

const Chart = (props) => {
  const expenses = props.exp;
  return (
    <div className="chart">
      {expenses.map((m) => (
        <ChartBar
          key={m.label}
          value={m.amount}
          label={m.title}
          maxVal={1000}
        />
      ))}
    </div>
  );
};

export default Chart;
